// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract StakingContract {
    address public owner;
    uint256 public interestRate;
    IERC20 public depositToken;
    IERC20 public returnToken;

    struct Stake {
        uint256 amount;
        uint256 startTime;
        uint256 endTime;
        uint256 lastClaimTime;
    }

    uint256 private constant SECONDS_IN_A_YEAR = 3.154e7;

    mapping(address => Stake[]) public stakes;

    event Deposit(address indexed user, uint256 amount, uint256 duration);
    event Claim(address indexed user, uint256 amount);

    constructor(uint256 _interestRate, address _depositToken, address _returnToken) {
        owner = address(this);
        interestRate = _interestRate;
        depositToken = IERC20(_depositToken);
        returnToken = IERC20(_returnToken);
    }

    function createDeposit(uint256 amount, uint256 duration) external {
        require(amount > 0, "Amount must be greater than zero");
        require(duration > 0, "Duration must be greater than zero");

        depositToken.approve(address(this), amount);

        require(depositToken.transferFrom(msg.sender, address(this), amount), "Deposit token transfer failed");
        require(returnToken.approve(address(this), amount), "Return token approval failed");

        Stake memory newStake = Stake(amount, block.timestamp, block.timestamp + duration, block.timestamp);
        stakes[msg.sender].push(newStake);

        emit Deposit(msg.sender, amount, duration);
    }

    function getReturns(address user) external {
        uint256 totalReturns;
        Stake[] storage userStakes = stakes[user];

        for(uint i = 0; i < userStakes.length; i++) {
            Stake storage stake = userStakes[i];

            if(block.timestamp >= stake.endTime) {
                uint256 _returns = (stake.amount * interestRate * (block.timestamp - stake.lastClaimTime)) / (SECONDS_IN_A_YEAR);
                totalReturns += _returns;
                stake.lastClaimTime = block.timestamp;

                require(returnToken.transfer(msg.sender, _returns), "Return token transfer failed");

                emit Claim(user, _returns);
            }
        }

        require(totalReturns > 0, "No returns available");
    }

    function getUserStakes(address user) external view returns(Stake[] memory) {
        return stakes[user];
    }

    function getTotalStakes(address user) external view returns(uint256) {
        Stake[] storage userStakes = stakes[user];
        uint256 totalStakes;

        for(uint i = 0; i < userStakes.length; i++) {
            totalStakes += userStakes[i].amount;
        }

        return totalStakes;
    }

    function getTotalReturns(address user) external view returns(uint256) {
        uint256 totalReturns;
        Stake[] storage userStakes = stakes[user];

        for(uint i = 0; i < userStakes.length; i++) {
            if(block.timestamp >= userStakes[i].endTime) {
                totalReturns += (userStakes[i].amount * interestRate * (block.timestamp - userStakes[i].lastClaimTime)) / (SECONDS_IN_A_YEAR);
            }
        }

        return totalReturns;
    }
}

